Prepend a stream with a value

```js
const { rxObserver } = require('api/v0.3');
const { interval } = require('rxjs');
const { startWith, take } = require('rxjs/operators');

interval(10)
  .pipe(
    take(5)
  )
  .subscribe(rxObserver('interval(10)'));

